import React from 'react'

import './card.component.scss'

export default function Card(props) {
    const { cardClickCallback }=props;
    const {result}=props

    const{ gender, name, email }=result

    const handleOnCardClick = () =>{
        cardClickCallback(result);
        console.log(result)
    }
    return (
        <div className='card-container' style={{background:(result && result === result) ? 'red' : "green"} }onClick={handleOnCardClick()}>
            <p className='p-gender'>{gender}</p>
            <p className='p-name'>{name.title} {name.first} {name.last}</p>
            <p className='p-email'>{email}</p>
        </div>
    )
}
